import React, { useState } from 'react';
import { registerUser } from '../api/authApi'; // make sure your API call matches this
import { useNavigate, Link } from 'react-router-dom';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import MenuItem from '@mui/material/MenuItem';
import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Paper';
import Alert from '@mui/material/Alert';

export default function RegisterPage() {
  const navigate = useNavigate();

  // Form fields
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [role, setRole] = useState('student');

  // Error display
  const [registrationError, setRegistrationError] = useState('');
  const [emailError, setEmailError] = useState(false);
  const [passwordError, setPasswordError] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setRegistrationError('');
    setEmailError(false);
    setPasswordError(false);

    try {
      await registerUser({ name, email, password, role });
      navigate('/login');
    } catch (err) {
      console.error('Registration failed:', err);

      let errorMsg = 'Registration failed. Please try again.';

      try {
        const data = err?.response?.data;

        // ✅ Case 1: FastAPI validation errors (array of error objects)
        if (Array.isArray(data?.detail)) {
          const first = data.detail[0];
          errorMsg = first?.msg || errorMsg;
          const loc = (first?.loc || []).join('.');
          if (loc.includes('email')) setEmailError(true);
          if (loc.includes('password')) setPasswordError(true);

        // ✅ Case 2: Plain string error from backend { detail: "User already exists" }
        } else if (typeof data?.detail === 'string') {
          errorMsg = data.detail;
          if (data.detail.toLowerCase().includes('already exists')) {
            setEmailError(true);
          }

        // ✅ Case 3: Unexpected object (e.g. { detail: {...} })
        } else if (typeof data?.detail === 'object') {
          errorMsg = JSON.stringify(data.detail);
        }

      } catch (parseErr) {
        console.error('Error while parsing backend error:', parseErr);
        errorMsg = 'Something went wrong while handling the error.';
      }

      setRegistrationError(errorMsg);
    }
  };

  return (
    <Box
      sx={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        minHeight: '100vh',
        backgroundColor: '#f5f5f5',
      }}
    >
      <Paper elevation={3} sx={{ p: 4, width: 360 }}>
        <Typography variant="h5" gutterBottom>
          Register
        </Typography>

        {registrationError && (
          <Alert severity="error" sx={{ mb: 2 }}>
            {registrationError}
          </Alert>
        )}

        <Box component="form" onSubmit={handleSubmit} sx={{ mt: 2 }}>
          <TextField
            label="Name"
            value={name}
            onChange={(e) => setName(e.target.value)}
            fullWidth
            margin="normal"
            required
          />

          <TextField
            label="Email"
            type="email"
            value={email}
            onChange={(e) => {
              setEmail(e.target.value);
              setEmailError(false);
            }}
            fullWidth
            margin="normal"
            required
            error={emailError}
            helperText={emailError ? 'This email is already registered.' : ''}
          />

          <TextField
            label="Password"
            type="password"
            value={password}
            onChange={(e) => {
              setPassword(e.target.value);
              setPasswordError(false);
            }}
            fullWidth
            margin="normal"
            required
            error={passwordError}
            helperText={passwordError ? 'Password must be at least 6 characters.' : ''}
          />

          <TextField
            select
            label="Role"
            value={role}
            onChange={(e) => setRole(e.target.value)}
            fullWidth
            margin="normal"
          >
            <MenuItem value="student">Student</MenuItem>
            <MenuItem value="trainer">Trainer</MenuItem>
          </TextField>

          <Button
            type="submit"
            variant="contained"
            color="primary"
            fullWidth
            sx={{ mt: 2 }}
          >
            Register
          </Button>

          <Box sx={{ mt: 1 }}>
            <Link to="/login">Back to Login</Link>
          </Box>
        </Box>
      </Paper>
    </Box>
  );
}
